import "./cadCargo.css"
import {UserCog2 } from 'lucide-react';

function CadCargo (){
    return(
        <>
            <div className="alinhar-cadCargo-content">
                <label className="edit-carCargo-label">
                    <UserCog2 size={18}/>
                    Nome do cargo
                </label>
                <input type="text" placeholder="Insira o nome para o novo cargo"></input>
            </div>
        </>
    )
}

export default CadCargo
